window.bookSummaryJSON = "<p>Book Six of the Demon Accords. For 17 years Declan O'Carroll has lived quietly in the upstate Vermont town of Castlebury, waiting impatiently for a chance to get out and meet the great wide world. When an odd new girl appears in town, Declan finds out that the world might be coming to meet him. But the big question remains...who is in more danger? Declan or the world? </p>"; 
